"   <div id=\"basicsTopicLeft\">",
"    <div id=\"topicTitle\">",
"     Patient information: Boxer&rsquo;s fracture (The Basics)",
"    </div>",
"    <span class=\"view\">",
"     View in",
"     <a class=\"lang\" href=\"./es-419/boxers-fracture-the-basics?source=topic_page\">",
"      Spanish",
"     </a>",
"    </span>",
"    <a class=\"contributor contributor_credentials\" href=\"./authors-and-editors/patient-information\">",
"     Written by the doctors and editors at UpToDate",
"    </a>",
"    <div id=\"topicText\">",
"     <p class=\"headingAnchor\" id=\"H157268072\">",
"      <span class=\"h1\">",
"       What is a boxer&rsquo;s fracture?",
"      </span>",
"      &nbsp;&mdash;&nbsp;A &ldquo;fracture&rdquo; is another word for a broken bone. A boxer&rsquo;s fracture is when a person breaks a specific part of 1 of the hand bones. The hand bones are also called the &ldquo;metacarpals&rdquo; (",
"      <a class=\"graphic graphic_figure graphicRef69018 \" href=\"UTD.htm?24/13/24789\">",
"       figure 1",
"      </a>",
"      ). The hand bone involved in a boxer&rsquo;s fracture is the bone between the little finger (pinky) and the wrist.",
"     </p>",
"     <p>",
"      Even though this fracture is called a boxer&rsquo;s fracture, it does not usually happen in boxers. Instead, it usually happens when people punch a wall or other hard object.",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H157268104\">",
"      <span class=\"h1\">",
"       What are the symptoms of a boxer&rsquo;s fracture?",
"      </span>",
"      &nbsp;&mdash;&nbsp;Symptoms of a boxer&rsquo;s fracture can include:",
"     </p>",
"     <p>",
"      <ul class=\"bulletCompact-block\">",
"       <li>",
"        Pain in the area of the fracture",
"       </li>",
"       <li>",
"        Swelling, usually on the back of the hand",
"       </li>",
"       <li>",
"        Bruising, usually on the palm of the hand",
"       </li>",
"       <li>",
"        The little finger or side of the hand looking like it&rsquo;s bent in an abnormal position",
"       </li>",
"      </ul>",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H157268119\">",
"      <span class=\"h1\">",
"       Is there a test for a boxer&rsquo;s fracture?",
"      </span>",
"      &nbsp;&mdash;&nbsp;Yes. Your doctor or nurse will ask about your symptoms, do an exam, and order an X-ray of your hand.",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H157268134\">",
"      <span class=\"h1\">",
"       How is a boxer&rsquo;s fracture treated?",
"      </span>",
"      &nbsp;&mdash;&nbsp;Treatment depends on how severe the fracture is.",
"     </p>",
"     <p>",
"      If you have an open cut with your fracture, your doctor will wash the cut out well. He or she will also give you a tetanus shot, if it&rsquo;s been too many years since your last one.",
"     </p>",
"     <p>",
"      For the first few days after your injury, your doctor will probably recommend 1 or more of the following:",
"     </p>",
"     <p>",
"      <ul class=\"bullet-block\">",
"       <li>",
"        Resting your hand",
"       </li>",
"       <li>",
"        Keeping your hand up above the level of your heart (as much as possible) &ndash; This is helpful only for the first few days after an injury.",
"       </li>",
"       <li>",
"        Putting ice on your hand &ndash; You can put a cold gel pack, bag of ice, or bag of frozen vegetables on the area every 1 to 2 hours, for 15 minutes each time. Put a thin towel between the ice (or other cold object) and your skin. Use the ice (or other cold object) for at least 6 hours after the injury. Some people find it helpful to ice up to 2 days after the injury.",
"       </li>",
"       <li>",
"        Taking pain medicine &ndash; If you have a lot of pain or a severe fracture, your doctor will prescribe a strong pain medicine. If your fracture is mild, your doctor might recommend that you take an over-the-counter pain medicine. Over-the-counter pain medicines include",
"        <a class=\"drug drug_patient\" href=\"UTD.htm?19/35/20021?source=see_link\">",
"         acetaminophen",
"        </a>",
"        (sample brand name: Tylenol&reg;),",
"        <a class=\"drug drug_patient\" href=\"UTD.htm?14/17/14614?source=see_link\">",
"         ibuprofen",
"        </a>",
"        (sample brand names: Advil&reg;, Motrin&reg;), and",
"        <a class=\"drug drug_patient\" href=\"UTD.htm?43/35/44597?source=see_link\">",
"         naproxen",
"        </a>",
"        (sample brand names: Aleve&reg;, Naprosyn&reg;).",
"       </li>",
"       <li>",
"        Wearing a splint &ndash; Wearing a splint keeps your hand bones in one position so that the fracture can heal. But before your doctor puts the splint on your hand, he or she will make sure your hand bones are in the correct position. If your bones are not in the correct position, he or she might need to do a procedure to put your bones back in the correct position.",
"       </li>",
"      </ul>",
"     </p>",
"     <p>",
"      Later on, you might need surgery to fix your hand bones. Whether you need surgery depends on your fracture.",
"     </p>",
"     <p>",
"      You might also need to work with a physical therapist (exercise expert) after your fracture heals. The physical therapist will show you exercises and stretches to strengthen your hand and finger muscles and keep them from getting stiff.",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H157268149\">",
"      <span class=\"h1\">",
"       How long does a boxer&rsquo;s fracture take to heal?",
"      </span>",
"      &nbsp;&mdash;&nbsp;A boxer&rsquo;s fracture usually takes 4 to 6 weeks to heal, depending on the type of fracture.",
"     </p>",
"     <p>",
"      Healing time also depends on the person. Healthy children usually heal much more quickly than older adults or adults with other medical problems.",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H157268164\">",
"      <span class=\"h1\">",
"       Can I do anything to improve the healing process?",
"      </span>",
"      &nbsp;&mdash;&nbsp;Yes. It&rsquo;s important to follow all of your doctor&rsquo;s instructions while your fracture is healing.",
"     </p>",
"     <p>",
"      Plus, doctors usually recommend that people with a fracture:",
"     </p>",
"     <p>",
"      <ul class=\"bulletCompact-block\">",
"       <li>",
"        Eat a healthy diet that includes getting enough calcium, vitamin D, and protein (",
"        <a class=\"graphic graphic_figure graphicRef79375 \" href=\"UTD.htm?18/13/18647\">",
"         figure 2",
"        </a>",
"        )",
"       </li>",
"       <li>",
"        Not damage their splint or get it wet",
"       </li>",
"       <li>",
"        Stop smoking &ndash; Fractures can take longer to heal if people smoke.",
"       </li>",
"      </ul>",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H157268202\">",
"      <span class=\"h1\">",
"       When should I call my doctor or nurse?",
"      </span>",
"      &nbsp;&mdash;&nbsp;After treatment, your doctor or nurse will tell you when to call him or her. In general, you should call him or her if:",
"     </p>",
"     <p>",
"      <ul class=\"bulletCompact-block\">",
"       <li>",
"        You have severe pain, or your pain or swelling gets worse.",
"       </li>",
"       <li>",
"        You have numbness or tingling in your fingers, or your fingers look blue or purple.",
"       </li>",
"       <li>",
"        You damage your splint.",
"       </li>",
"      </ul>",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H157268217\">",
"      <span class=\"h1\">",
"       More on this topic",
"      </span>",
"     </p>",
"     <p>",
"      <a class=\"medical medical_basics\" href=\"UTD.htm?29/34/30243?source=see_link\">",
