"      </a>",
"      <br/>",
"      <a class=\"medical medical_basics\" href=\"UTD.htm?35/21/36179?source=see_link\">",
"       Patient information: Giving your child over-the-counter medicines (The Basics)",
"      </a>",
"      <br/>",
"      <a class=\"medical medical_basics\" href=\"UTD.htm?17/46/18146?source=see_link\">",
"       Patient information: Quitting smoking (The Basics)",
"      </a>",
"     </p>",
"     <p>",
"      <a class=\"medical medical_patient\" href=\"UTD.htm?19/13/19670?source=see_link\">",
"       Patient information: Quitting smoking (Beyond the Basics)",
"      </a>",
"      <br/>",
"      <a class=\"medical medical_patient\" href=\"UTD.htm?22/60/23491?source=see_link\">",
