var title_f5_6_5225="Purine interconversion and degradation";
var content_f5_6_5225=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=RHEUM%2F75554&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=RHEUM%2F75554&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\" style=\"width: 681px\">",
"   <div class=\"ttl\">",
"    Purine interconversion and degradation in humans",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 661px; height: 820px; background-image: url(data:image/jpeg;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    Using abbreviated structural diagrams this figure schematically shows the two purine nucleotides (adenosine monophosphate and guanosine monophosphate), nucleosides (adenosine and guanosine), and bases (adenine and guanine) as well as the corresponding intermediary molecules (inosine monophosphate, inosine, and hypoxanthine). All endogenously produced and dietary purines share the same final pathway of degradation: via inosine, hypoxanthine, xanthine, and urate/uric acid. The enzyme xanthine oxidase, which catalyzes two steps in this process, is inhibited by the drugs allopurinol and febuxostat. The enzymes hypoxanthine-guanine phosphoribosyltransferase (HPRT) and adenine phosphoribosyltransferase (APRT) catalyze salvage of purine bases by recycling them to ribonucleotides without increased net purine synthesis.",
"    <div class=\"footnotes\">",
"     5'-NT: 5-prime nucleotidase; ADA: adenosine deaminase; AK: adenosine kinase; AMPD: adenosine monophosphate deaminase; APRT: adenine phosphoribosyltransfersase; GDA: guanine deaminase (or guanase); HPRT: hypoxanthine-guanine phosphoribosyltransferase; PNP: purine nucleoside phosphorylase; XO: xanthine oxidase.",
"    </div>",
"    <div class=\"reference\">",
"     Courtesy of Jerry Greene, MD.",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
