var title_f5_6_5229="Mechanisms of malabsorption";
var content_f5_6_5229=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=GAST%2F54743&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=2\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=GAST%2F54743&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=2\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\">",
"   <div class=\"ttl\">",
"    Malabsorption: Examples of conditions causing malabsorption, categorized by the phase of absorption that is impaired",
"   </div>",
"   <div class=\"cntnt\">",
"    <table cellspacing=\"0\">",
"     <tbody>",
"      <tr>",
"       <td class=\"subtitle1\">",
"        Phase and nature of malabsorptive defect",
"       </td>",
"       <td class=\"subtitle1\">",
"        Example",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle2_left\" colspan=\"2\">",
"        Luminal phase",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"sublist1_start\" colspan=\"2\">",
"        A. Substrate hydrolysis",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"sublist1\">",
"        1. Digestive enzyme deficiency",
"       </td>",
"       <td class=\"sublist_other\">",
"        Chronic pancreatitis",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"sublist1\">",
"        2. Digestive enzyme inactivation",
"       </td>",
"       <td class=\"sublist_other\">",
"        Zollinger-Ellison syndrome",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"sublist1\">",
"        3. Dyssynchrony of enzyme release, inadequate mixing",
"       </td>",
"       <td class=\"sublist_other\">",
"        Post Billroth II procedure",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"sublist1_start\" colspan=\"2\">",
"        B. Fat solubilization",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"sublist1\">",
"        1. Diminished bile salt synthesis",
"       </td>",
"       <td class=\"sublist_other\">",
"        Cirrhosis",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"sublist1\">",
"        2. Impaired bile secretion",
"       </td>",
"       <td class=\"sublist_other\">",
"        Chronic cholestasis",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"sublist1\">",
"        3. Bile salt de-conjugation",
"       </td>",
"       <td class=\"sublist_other\">",
"        Bacterial overgrowth",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"sublist1\">",
"        4. Increased bile salt loss",
"       </td>",
"       <td class=\"sublist_other\">",
"        Ileal disease or resection",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"sublist1_start\" colspan=\"2\">",
"        C. Luminal availability of specific nutrients",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"sublist1\">",
"        1. Diminished gastric acid",
"       </td>",
"       <td class=\"sublist_other\">",
"        Atrophic gastritis - vitamin B12",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"sublist1\">",
"        2. Diminished intrinsic factor",
"       </td>",
"       <td class=\"sublist_other\">",
"        Pernicious anemia - vitamin B12",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"sublist1\">",
"        3. Bacterial consumption of nutrients",
"       </td>",
"       <td class=\"sublist_other\">",
"        Bacterial overgrowth - vitamin B12",
"       </td>",
"      </tr>",
"      <tr class=\"divider_top\">",
"       <td class=\"subtitle2_left\" colspan=\"2\">",
"        Mucosal (absorptive) phase",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"sublist1_start\" colspan=\"2\">",
"        A. Brush border hydrolysis*",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"sublist1\">",
"        1. Congenital disaccharidase defect",
"       </td>",
"       <td class=\"sublist_other\">",
"        Sucrase-isomaltase deficiency",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"sublist1\">",
"        2. Acquired disaccharidase defect",
"       </td>",
"       <td class=\"sublist_other\">",
"        Lactase deficiency",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"sublist1_start\" colspan=\"2\">",
"        B. Epithelial transport",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"sublist1\">",
"        1. Nutrient-specific defects in transport",
"       </td>",
"       <td class=\"sublist_other\">",
"        Hartnup's disease",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"sublist1\">",
"        2. Global defects in transport",
"       </td>",
"       <td class=\"sublist_other\">",
"        Celiac sprue",
"       </td>",
"      </tr>",
"      <tr class=\"divider_top\">",
"       <td class=\"subtitle2_left\" colspan=\"2\">",
"        Postabsorptive, processing phase",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        A. Enterocyte processing",
"       </td>",
"       <td>",
"        Abetalipoproteinemia",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        B. Lymphatic",
"       </td>",
"       <td>",
"        Intestinal lymphangiectasia",
"       </td>",
"      </tr>",
"     </tbody>",
"    </table>",
"   </div>",
"   <div class=\"lgnd\">",
"    <div class=\"footnotes\">",
"     * This process is sometimes considered as part of the luminal phase.",
"    </div>",
"    <div class=\"reference\">",
"     Reproduced with permission from: Sleisenger MH, Fordtran JS (Eds), Gastrointestinal Diseases, 5th ed, 1993, W.B. Saunders, Philadelphia. p.1010. Copyright &copy; 1993 W.B. Saunders.",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
